import Navbar from "./Navbar";

function Header() {
  return (
    <div id="main">
      <Navbar />

      <div className="name">
        <h1>
          It's a <span>ReactJS</span>Website
        </h1>
        <p>
          Lorem ipsum, dolor sit amet consectetur adipisicing elit. Eos placeat
          pariatur nulla exercitationem iusto.
        </p>
      </div>
    </div>
  );
}

export default Header;
